<p>在世界经济全球化的背景下，当代艺术呈现丰富的多元文化特征。同时，各个国家和地区积极发展本土艺术的同时，也积极参与艺术的交流与对话 不同文化特质的艺术共存互动现象更加凸显，艺术与社会的联系愈加紧密，创意产业和艺术市场不断壮大，文化消费中的高雅艺术和大众艺术受到关注。以数字媒体技术为核心的媒介变革在当代艺术嬪变中的作用越来越大，推动了艺术各门类在内容形式和审美特征上的发展变化。</p>
